ation:{label:"Ranchi Municipal Corporation"},districtRanchi:{label:"Ranchi"},cityRanchi:{label:"Ranchi"},stateRanchi:{label:"Jharkhand"},addressRanchi:{label:"4th Floor Project Building, Dhurwa, Ranchi"},phoneRanchi:{label:"18008904115"},faxRanchi:{label:"0651-3500700"},websiteRanchi:{label:"udhd.jharkhand.gov.in"},emailRanchi:{label:"ud.secy@gmail.com"},aboutUs:{label:"About Us"},udhdDescription1:{label:"The {{brand_name}} - {{brand_tag}} is the nodal Department of the Government of Jharkhand, responsible for ensuring proper and planned growth of cities and towns. It aims to provide adequate infrastructure, amenities, and services to citizens through Urban Local Bodies and agencies. UD&HD, GoJ also works on formulating policies for urban development activities, creating urban infrastructure, and implementing various poverty alleviation programs."},udhdDescription2:{label:"The Department has been taking concrete measures for efficient management & delivery of civic services like provision of affordable housing, safe drinking water, sanitation including solid waste management, storm water drainage, sewerage, roads, public transport; and creation of livelihood opportunities for urban poor by accelerating economic growth of cities/towns and building capacity of the urban poor. The Development & Housing Department is headed by the Minister, {{brand_tag}}, GoJ. The Additional Chief Secretary, Urban Development & Housing Department is the administrative head of the Department. The office of Urban Development & Housing Department is located at Ranchi town (i.e, the capital of the state) in Project Building."},vision:{label:"Vision"},visionPara1:{label:"To ensure planned and inclusive development of cities/towns into liveable, economically vibrant and productive, sustainable and efficient entities with provision of adequate and durable public infrastructure and amenities, including affordable housing, various municipal services and livelihood opportunities for all sections of society and bringing out efficiency in the service delivery mechanisms, community participation and accountability of Urban Local Bodies and agencies towards citizens, in convergent manner."},visionPara2:{label:"We believe that the answers to todayâ€™s biggest social challengesâ€”from climate change and environmental justice to affordable housing and workforce developmentâ€”require creative, multidisciplinary, and community-driven solutions. Our ULBs and other stakeholder are prepared to think critically and comprehensively about these solutions and to foster meaningful community engagement as part of the decision-making process. The {{brand_tag}}, GoJ is an intellectually exciting, creative, and productive community with largest professionalâ€™s resource."},objective:{label:"Objective"},objectivePara:{label:"To ensure planned and inclusive development of cities/towns into liveable, economically vibrant and productive, sustainable and efficient entities with provision of adequate and durable public infrastructure and amenities, including fulfil need of affordable housing for Economically Weaker Sections (EWS) & Slum Dwellers, Lower Income Group (LIG), Middle Income Group (MIG) and Higher Income Group(HIG) families in systematic manners. The {{brand_tag}}, GoJ also provide various municipal services and livelihood opportunities for all sections of society and bringing out efficiency in the service delivery mechanisms, community participation and accountability of Urban Local Bodies and agencies towards citizens, in convergent manner."},functions:{label:"Functions"},function1:{label:"Facilitating reforms and policy interventions to improve the financial base of ULBs & their interface with citizens in service delivery."},function2:{label:"Improving urban planning, governance & capacity development of the ULB personnel for effective implementation of plans and rules, efficient urban management and service delivery."},function3:{label:"Enhancing service standards, choice of citizens, transparency, accountability and simplifying process for grievance redressal."},function4:{label:"Encouraging PPP projects for urban infrastructure development and urban services including Municipal service."},function5:{label:"Effectively implementing affordable housing schemes for the Economically Weaker Sections, Lower Income Group, Lower Middle Income Group and Middle Income Group."},function6:{label:"Effectively implementing programmes for urban poverty reduction."},function7:{label:"Effectively implementing and operating water supply, sewerage, solid-waste management, storm water drainage and other urban development projects."},function8:{label:"Encouraging innovations in urban development."},function9:{label:"To increase substantial investment for creation of Urban Infrastructure."},function10:{label:"Provision of inbuilt system in each project for Operation and Maintenance (O&M)."},function11:{label:"Strengthening and securing the financial base of ULBs."},function12:{label:"Reforming system of service delivery."},function13:{label:"Ensuring access to service for all including the poor to meet the recommended norms."},function14:{label:"Recruitment of Human Resources for various sanctioned posts in ULBs and State level."},function15:{label:"Proposal to declare Metropolitan Area for million plus towns."},function16:{label:"Creation of Urban Local Bodies in new eligible urban settlements as per prevailing laws."},function17:{label:"Declaration of Industrial Town as per norms laid down in the constitution."},function18:{label:"Preparation of Master Plan and City Development Plan with a perspective of 25-30 years of towns and cities."},function19:{label:"To encourage Public Private Participation (PPP) Model in the water supply scheme and it is proposed to take up urban water supply scheme in PPP mode."},function20:{label:"To place proper Solid Waste Management System in all ULBs with latest technical know-how available in this field."},function2